import React, { useState, useEffect, useRef } from 'react';
import Card from './Card';
import { getJokes } from './api';

function Home() {
  const [jokes, setJokes] = useState([]);

  useEffect(() => {
    const jokes = getJokes();
    setJokes(jokes);
  }, []);

  return (
    <div>
      {jokes.map((joke, index) => (
        <Card key={index} joke={joke} />
      ))}
    </div>
  );
}

export default Home;
